/* eslint-disable */

import './css/reset.css';
import './jw/jw-library.css';
import { JwLibrary } from './jw/jw-library.js';

import { useEffect, lazy, Suspense } from "react";
import { useSelector, useDispatch } from "react-redux";
import { Routes, Route, Link, useNavigate } from "react-router-dom";

const TestComponent = lazy(() => import("./TestComponent.js"));

function App() {

  window.jw = new JwLibrary();

  let [title, setTitle] = useState("안녕하세요.");

  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Link to="/about">어바웃페이지로 이동</Link>} />
        <Route path="/about" element={<Link to="/">메인페이지로 이동</Link>} />
      </Routes>
      <main className="jw">
        <Suspense fallback={<div>로딩중임</div>}>
          <TestComponent title={title} setTitle/>
        </Suspense>
      </main>
    </div>
  );
}

export default App;
